 passado e se adapta com facilidade às mudanças no ambiente de trabalho.&quot;],false,null,null,64595961],[null,null,[&quot;4.1.1 Estabelece e comunica metas claras e desafiadoras para si e/ou seus times. Cria planos de ação detalhados e monitora o progresso regularmente para garantir que os resultados sejam alcançados.&quot;],false,null,null,93541963],[null,null,[&quot;9.2.1 Possui habilidade em realizar multiplas tarefas ao mesmo tempo, sabendo priorizar a ordem de entrega se empenhando sempre em atingir às necessidades do negócio a curto e longo prazo.&quot;],false,null,null,97302382],[null,null,[&quot;8.1.2 Resistente em fazer diferente do que normalmente faz, tem menos iniciativa, mas quando motivado traz novas idéias ou soluções.&quot;],false,null,null,149525115],[null,null,[&quot;2.2.1  Busca ativamente por conhecimentos, participando com frequência de treinamentos e outras oportunidades de aprendizagem. Aplica o que aprende na sua rotina de trabalho, melhorando sua performance.&quot;],false,null,null,191719258],[null,null,[&quot;5.2.1 É capaz de ouvir as preocupações e perspectivas sem interrompê-los ou tentar apressar a conversa. Consegue se colocar no lugar do outro e compreender seus pontos de vista, sem fazer julgamentos precipitados ou assumir que já sabe tudo sobre a situação.&quot;],false,null,null,234523338],[null,null,[&quot;3.2.1  Tem cuidado e zelo com os recursos da empresa, buscando otimizá-los e preservá-los. Analisa os riscos e benefícios das suas decisões, buscando gerar valor para a empresa.&quot;],false,null,null,243314296],[null,null,[&quot;3.1.1 Se incomoda quando vê coisas erradas e está sempre contribuindo com outras áreas visando o crescimento da empresa. É comprometido e engajado com as metas e busca alcançá-las com qualidade e eficiência, se responsabilizando sempre pelos seus erros e acertos.&quot;],false,null,null,256358365],[null,null,[&quot;1.1.1 Se coloca no lugar do cliente, utilizando pesquisas, feedbacks e interações ativas para entender com profundidade as necessidades dos clientes.&quot;],false,null,null,262002855],[null,null,[&quot;8.2.1 Está sempre incomodado e disposto a considerar diferentes abordagens e soluções, mesmo que isso signifique abandonar uma abordagem antiga. Busca ativamente soluções e idéias para melhorar o resultado da empresa.&quot;],false,null,null,270347177],[null,null,[&quot;9.1.1 Capacidade em buscar padrões mais altos de desempenho, identificando oportunidades de melhoria e reagindo de forma positiva às mudanças. Atinge ou supera as metas estabelecidas, desafiando seu time a sair da zona de conforto.&quot;],false,null,null,298114638],[null,null,[&quot;9.4.2 Está disposto a investir tempo e esforço para melhorar seus resultados, mas nem sempre coloca suas atividades em primeiro lugar&quot;],false,null,null,487384150],[null,null,[&quot;7.2.2 Suas soluções nem sempre são rápidas e de fácil implementação.&quot;],false,null,null,489048745],[null,null,[&quot;7.4.1 Tem a capacidade em avaliar os processos e identificar ações que possam simplificar o trabalho e eliminar atividades desnecessárias, evitando problemas e desperdícios de tempo e recursos.&quot;],false,null,null,520227607],[null,null,[&quot;8.4.1 Tem habilidades e comportamentos que contribui no processo de mudanças, tem uma abordagem proativa, é capaz de motivar, liderar e engajar a equipe sendo resiliente para garantir uma mudança bem-sucedida.&quot;],false,null,null,729721161],[null,null,[&quot;5.5.1 É flexível e habilidoso na negociação, focado no resultado e capaz de resolver problemas. Age de forma ética e respeita os valores da empresa.&quot;],false,null,null,773246284],[null,null,[&quot;4.3.1 Demonstra capacidade de antecipar problemas, lida com situações inesperadas ou problemas que surgem no dia a dia, tendo iniciativa para propor soluções e sugestões para melhorar processos ou procedimentos. Está sempre disposto a ajudar.&quot;],false,null,null,786300893],[null,null,[&quot;7.5.1 É receptivo a novas ideias e está disposto a experimentar novas abordagens para melhorar o trabalho. Busca sempre novos conhecimentos, incentivando a troca de ideias e aprendizados entre os membros da equipe.&quot;],false,null,null,786631686],[null,null,[&quot;1.4.1  Identifica problemas potenciais ou oportunidades antes deles ocorrerem e age para preveni-los ou aproveitá-los.&quot;],false,null,null,899975372],[null,null,[&quot;2.1.3 Apresenta desinteresse em identificar seus pontos de desenvolvimento, é estagnado profissionalmente e não busca seu desenvolvimento.&quot;],false,null,null,909292731],[null,null,[&quot;4.4.1 Está sempre atento aos objetivos e metas estabelecidos, se esforça para alcançá-los da melhor maneira possível, planeja e gerencia seu tempo e recursos de forma eficaz e analisa dados relevantes para tomar as decisões informadas e orientadas a resultados.&quot;],false,null,null,929308412],[null,null,[&quot;5.3.1 Mantém uma atitude aberta e recepitiva a feedbacks, entendendo que é uma oportunidade para crescer e se desenvolver. Se comunica de forma respeitosa e oferece sugestões construtivas para ajudar seus parceiros a melhorar. Preza pelo seu bom desenvolvimento e seus pares.&quot;],false,null,null,966732122],[null,null,[&quot;4.5.1 Tem a capacidade de permanecer motivado e persistir na busca dos próprios objetivos e da empresa mesmo diante de problemas. Nos momentos de interferências, recupera o foco rapidamente, se mantendo sempre positivo diante as circustâncias.&quot;],false,null,null,1068198219],[null,null,[&quot;7.3.1 É proativo e busca constantemente maneiras de melhorar processos, reduzir custos e aumentar a produtividade. Procura sempre ir além e encontrar maneiras de entregar mais resultados com menos recursos, mesmo em situações desafiadoras, saindo da sua zona de conforto.&quot;],false,null,null,1080188798],[null,null,[&quot;Valdecy Alves&quot;],false,null,null,1080433787],[null,null,[&quot;1.5.1  Demonstra curiosidade e interesse em aprender sobre as novidades e tendências do mercado e busca feedbacks constantes dos clientes para sugerir melhorias. Visa sempre proporcionar uma excelente experiência em nossa empresa.&quot;],false,null,null,1150279310],[null,null,[&quot;7.1.1 Apresenta capacidade de inventar, adaptar ou inovar soluções criativas e conscientes, de forma simples. Pensa fora da caixa, contribuindo com oportunidades de melhoria e crescimento da sua área de atuação e da empresa.&quot;],false,null,null,1198926725],[null,null,[&quot;1.2.1 Coloca o cliente em primeiro lugar, otimizando os recursos e processos da empresa para atendê-lo.&quot;],false,null,null,1232659268],[null,null,[&quot;3.4.1 Conhece e se interessa pelo negócio da empresa, pelos clientes, concorrentes e parceiros. Entende como o seu trabalho contribui para os objetivos estratégicos da empresa e toma decisões pensando nos impactos futuros.&quot;],false,null,null,1304146325],[null,null,[&quot;Marcelo &quot;],false,null,null,1449005772],[null,null,[&quot;2.4.1 Demonstra habilidade e interesse em se comunicar e se relacionar com diferentes pessoas e compartilha seus aprendizados com sua rede de relacionamentos.&quot;],false,null,null,1521901325],[null,null,[&quot;2.3.2 Manifesta pouca disposição para assumir novas responsabilidades alinhadas com seus interesses ou objetivos pessoais.&quot;],false,null,null,1526909297],[null,null,[&quot;3.3.2 Apresenta algumas ideias e soluções, colocando-as em prática em determinadas situações.&quot;],false,null,null,1532345538],[null,null,[&quot;5.1.1 Transmite informações de maneira clara, objetiva, primando pela escuta ativa. Mantem um diálogo eficiente, em que o ouvinte é capaz de interpretar e assimilar todo o conteúdo que é expresso pelo interlocutor, de forma sincera.&quot;],false,null,null,1596608619],[null,null,[&quot;5.4.1 Se apresenta de forma segura, argumentando com autoridade e embasamento. Seu posicionamento influencia seus pares, utilizando de uma linguagem adequada com argumentos sólidos e coerentes.&quot;],false,null,null,1664814056],[null,null,[&quot;8.5.1 É capaz de lidar com situações de pressão e incerteza com confiança e resiliência. Confia em suas habilidades para enfrentar desafios.&quot;],false,null,null,1689333965],[null,null,[&quot;F15&quot;],false,null,null,1961083325],[null,null,[&quot;9.5.1 É proativo, não apenas resolve os problemas de forma imediata, mas também se preocupa em evitar que ocorram novamente. Garante que a solução do problema seja completa e definitiva.&quot;],false,null,null,1961190922],[null,null,[&quot;1.3.1  Está sempre pronto para atender ao cliente, buscando entregar a melhor experiência na interação, sendo criativo em contornar dificuldades.&quot;],false,null,null,1985248810],[null,null,[&quot;2.5.1 Tem a capacidade para lidar com situações adversas e busca aprender com seus erros e feedbacks recebidos. Enfrenta os desafios com confiança e determinação.&quot;],false,null,null,2091851851],[null,null,[&quot;9.3.1 Possui objetivos claros e mensuráveis para que seja fácil acompanhar o progresso. Se certifica de que todos os membros da equipe estejam cientes dos objetivos e de como serão medidos.&quot;],false,null,null,2094288744]]]" data-shuffle-seed="42686085037094340" data-clean-viewform-url="https://docs.google.com/forms/d/e/1FAIpQLScc4ejkXS-NEj4juvYIpBT7-aV7vzDV7zPSyHlzFqjY6tC8nw/viewform" data-response="%.@.[]]" data-dlp-data="%.@.null,false,[]]" data-first-entry="0" data-last-entry="51" data-is-first-page="true"><div jscontroller="yUS4Lc" jsaction="rcuQ6b:rcuQ6b;UxRBlf:rcuQ6b;"><div jsname="o6bZLc"></div></div><div class="RH5hzf RLS9Fe"><div class="lrKTG"><div class="Dq4amc"><div class="m7w29c O8VmIc tIvQIf"><noscript><div class="HB1eCd-X3SwIb-haAclf"><div class="HB1eCd-X3SwIb-i8xkGf"><div class="tk3N6e-cXJiPb tk3N6e-cXJiPb-TSZdd tk3N6e-cXJiPb-GMvhG">O JavaScript não está habilitado em seu navegador. Em função disso, não é possível abrir este arquivo. Habilite o JavaScript e atualize a página.</div></div><br></div><
